import React from "react";

export default function Paragrafo(props){
    return(
        <>
             <label>{props.label}
            <p>
            Argentina, oficialmente República Argentina, é o segundo maior país da América do Sul
             em território e o terceiro em termos de população, constituída como uma federação de 23 
             províncias e uma cidade autônoma, Buenos Aires, capital
             do país. É o oitavo maior país do mundo em área territorial e o maior entre as nações de 
             língua espanhola, embora México, Colômbia e Espanha, que possuem menor território, sejam mais populosos.
            </p>    
            </label>

        </>
    )
}
